DEFINE TENANT_ID = '&1'
SET FEEDBACK ON
SET SERVEROUTPUT ON


--REM Add one ITA OOB Resource Analytics - Host
DECLARE
  V_COUNT NUMBER;
  DSB_ID CONSTANT NUMBER:=19;
  TILE_ID CONSTANT NUMBER:=32;
  screenshot CLOB:='data:image/png;base64,'||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
'FMD/A/EtZyfRYMl5AAAAAElFTkSuQmCC';
  
BEGIN
  SELECT COUNT(1) INTO V_COUNT FROM EMS_DASHBOARD WHERE TENANT_ID='&TENANT_ID' AND DASHBOARD_ID=DSB_ID;
  IF (V_COUNT>0) THEN
    DBMS_OUTPUT.PUT_LINE('ITA OOB dashboard: Resource Analytics - Host already exists for: &TENANT_ID, no need to add again');  
  ELSE
    Insert into EMS_DASHBOARD (DASHBOARD_ID,NAME,TYPE,DESCRIPTION,CREATION_DATE,LAST_MODIFICATION_DATE,LAST_MODIFIED_BY,OWNER,IS_SYSTEM,APPLICATION_TYPE,ENABLE_TIME_RANGE,DELETED,TENANT_ID,SCREEN_SHOT) 
    values (DSB_ID,'Resource Analytics: Host',1,'Resource Analytics: Host',SYS_EXTRACT_UTC(SYSTIMESTAMP),SYS_EXTRACT_UTC(SYSTIMESTAMP),null,'Oracle',1,2,0,0,'&TENANT_ID', screenshot);
    
    Insert into EMS_DASHBOARD_TILE (TILE_ID,DASHBOARD_ID,CREATION_DATE,LAST_MODIFICATION_DATE,LAST_MODIFIED_BY,OWNER,TITLE,HEIGHT,WIDTH,IS_MAXIMIZED,POSITION,TENANT_ID,
    WIDGET_UNIQUE_ID,WIDGET_NAME,WIDGET_DESCRIPTION,WIDGET_GROUP_NAME,WIDGET_ICON,WIDGET_HISTOGRAM,WIDGET_OWNER,WIDGET_CREATION_TIME,WIDGET_SOURCE,WIDGET_KOC_NAME,WIDGET_VIEWMODE,WIDGET_TEMPLATE,PROVIDER_NAME,PROVIDER_VERSION,PROVIDER_ASSET_ROOT) 
    values (TILE_ID,DSB_ID,SYS_EXTRACT_UTC(SYSTIMESTAMP),null,null,'Oracle','Home',220,2,0,0,'&TENANT_ID',
    '0','Invisible Name','Invisible Description','Invisible Widget Group','Invisible icon','Invisible historgram','Oracle',to_char(SYS_EXTRACT_UTC(SYSTIMESTAMP),'YYYY-MM-DD"T"HH24:MI:SS.ff3"Z"'),0,'DF_V1_WIDGET_ONEPAGE','../emcsDependencies/widgets/onepage/js/onepageModel','../emcsDependencies/widgets/onepage/onepageTemplate.html','emcitas-ui-apps','1.0','verticalApplication.svr-resource');

    Insert into EMS_DASHBOARD_LAST_ACCESS (DASHBOARD_ID,ACCESSED_BY,ACCESS_DATE,TENANT_ID) 
    values (DSB_ID,'Oracle',SYS_EXTRACT_UTC(SYSTIMESTAMP),'&TENANT_ID');
    COMMIT;
    DBMS_OUTPUT.PUT_LINE('Add ITA OOB dashboard: Resource Analytics: Host successfully for tenant: &TENANT_ID');  
  END IF;
EXCEPTION
WHEN OTHERS THEN
  ROLLBACK;
  DBMS_OUTPUT.PUT_LINE('Failed to ITA OOB dashboard: Resource Analytics: Host for tenant: &TENANT_ID due to '||SQLERRM);   
  RAISE;
END;
/

