--REM Alter 'Performance Analytics: Middleware' to 'Performance Analytics Application Server' and its screenshot
DECLARE
  V_COUNT NUMBER;
  DSB_ID CONSTANT NUMBER:=4;
  screenshot CLOB:='data:image/png;base64,'||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
''||
'';
  
BEGIN
  SELECT COUNT(1) INTO V_COUNT FROM EMS_DASHBOARD WHERE TENANT_ID='&TENANT_ID' AND DASHBOARD_ID=DSB_ID AND NAME='Performance Analytics: Middleware';
  IF (V_COUNT>0) THEN
    UPDATE EMS_DASHBOARD SET NAME='Performance Analytics Application Server', SCREEN_SHOT=screenshot WHERE TENANT_ID='&TENANT_ID' AND DASHBOARD_ID=DSB_ID AND NAME='Performance Analytics: Middleware';
    COMMIT;
    DBMS_OUTPUT.PUT_LINE('Alter Performance Analytics: Middleware name and screenshot successfully for tenant: &TENANT_ID');  
  ELSE
    DBMS_OUTPUT.PUT_LINE('OOB dashboard: Performance Analytics: Middleware not exists for: &TENANT_ID, no need to add again');  
  END IF;
EXCEPTION
WHEN OTHERS THEN
  ROLLBACK;
  DBMS_OUTPUT.PUT_LINE('Failed to alter Performance Analytics: Middleware name and screenshot for tenant: &TENANT_ID due to '||SQLERRM);   
  RAISE;
END;
/

